import React from 'react'
import { Link } from 'react-router-dom';
import { Button } from 'react-bootstrap';
import MetricsService from '../services/MetricsService';



class DetailsMetrics extends React.Component{

  state = {
    metricsInfo: []
  }

  service = new MetricsService()


  componentDidMount(){
    this.service.
    getAllMetrics(this.props.loggedInUser._id) //=> LLAMADA A MI API PARA DEVOLVER TODOS LOS EJERCICIOS DEL USUARIO ACTIVO
    .then((data)=>{
      return data.json()
    })
    .then((dataJSON)=>{
      this.setState({metricsInfo: dataJSON.results})
    })
    .catch((err)=>{
      console.log(err)
    })
  }


  render(){
    return(
      <div className="DetailsMetrics">
        <Button variant="warning">
          <Link to="/add-new-metrics">Add new entry</Link>
        </Button>
      </div>
    )    
  }
}

export default DetailsMetrics
